alex_action_4 =  tok (eitherResIdent T_Nat) 
alex_action_5 =  tok (eitherResIdent T_Str) 
alex_action_6 =  tok (eitherResIdent T_Hex) 
alex_action_7 =  tok (eitherResIdent TV) 
